-- Deploy donm:0035-iota-indicators to pg
-- requires: 0034-goal-unit

BEGIN;

create table indicator (
    id           integer primary key,
    name         text not null,
    explanation  text not null,
    formula      text not null,
    UNIQUE(name)
);



create table region_indicator (
    id               serial primary key,
    region_id        integer not null references region(id),
    indicator_id     integer not null references indicator(id),
    value            numeric(8, 2) not null,
    year             integer not null,
    sources          text[],
    url_observatorio text not null,
    UNIQUE(region_id, indicator_id)
);


COMMIT;
