INSERT INTO indicator (id, name, explanation, formula) VALUES ('156', 'Homicídio juvenil', 'Número de mortes por homicídio, na faixa etária de 15 a 29 anos (inclusive) ocorridos no município, por 100 mil habitantes.', 'Número total de mortes por homicídio de jovens homens com idade de 15 a 29 anos ÷ População masculina na faixa etária de 15 a 29 anos × 100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('258', 'Empregos', 'Número de empregos por 10 mil habitantes.', 'Número total de empregos / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('112', 'Mortalidade por doenças do aparelho circulatório', 'Número de mortes por doenças do aparelho circulatório, por dez mil habitantes. As principais causas de morte relacionadas ao aparelho circulatório são o AVC (acidente vascular cerebral), também conhecido como derrame, doença isquêmica do coração e infarto do miocárdio.', 'Número total de óbitos por doenças do aparelho circulatório / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('152', 'Agressão a idoso', 'Número de internações na rede pública, de pessoas de 60 anos ou mais, por causas relacionadas a possível agressão, por 10 mil habitantes nessa faixa etária.', 'Número total de internações de pessoas residentes, de 60 anos ou mais, por causas relacionadas a possível agressão / População com 60 anos ou mais *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('168', 'Mortes com motocicleta', 'Número de mortes de ocupantes de motocicleta, por 10 mil habitantes.', 'Total de mortes de ocupantes de motocicleta / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('158', 'Homicídios', 'Número de óbitos por homicídio, por 100 mil habitantes', 'Número total de óbitos por homicídio ÷ População total × 100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('151', 'Agressão a crianças e adolescente', 'Número de internações de crianças de 0 a 14 anos por causas relacionadas a possíveis agressões, por 10 mil crianças nessa faixa etária.', 'Número total de internações de crianças residentes, de até 14 anos por causas relacionadas a possíveis agressões / População na faixa etária de 0 a 14 anos *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('115', 'Mortalidade materna', 'Proporção de óbitos femininos por causas maternas, em relação aos nascidos vivos de mães residentes no município, por dez mil nascidos vivos.', 'Número total de óbitos por causas maternas / Número total de nascidos vivos *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('3718', 'Mortalidade específica por aids', 'Número de óbitos pela síndrome da imunodeficiência adquirida (aids), por 10 mil habitantes, na população residente em determinado espaço geográfico, no ano considerado.', 'Número de óbitos de residentes por aids / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('169', 'Mortes com automóvel', 'Número de mortes de ocupantes de automóveis e caminhonetes por 10 mil habitantes', 'Total de mortes de ocupantes de automóveis e caminhonetes / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('268', 'Mortalidade por causas mal definidas', 'Porcentagem de óbitos por causas mal definidas na sua declaração.', 'Número total de óbitos por causas mal definidas *100 / Número total de óbitos');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('132', 'Acervo de livros infanto-juvenis', 'Número de livros infanto-juvenis disponíveis em acervos de bibliotecas municipais por habitante na faixa etária de 7 a 14 anos.', 'Número de livros infanto-juvenis disponíveis em acervos de bibliotecas / População na faixa etária de 7 a 14 anos');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('270', 'Museus', 'Número de museus, municipais, estaduais, federais e particulares, por 10 mil habitantes.', 'Número total de museus / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('296', 'Salas de show e concerto', 'Número de salas de show e concerto, municipais, estaduais, federais e particulares,  por 100 mil habitantes.', 'Número total de salas de show e concerto / População total *100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('184', 'População em situação de rua', 'Percentual da população em situação de rua em relação ao total da população.  *Moradores de rua: pessoas que não têm moradia e que pernoitam nas ruas, praças, calçadas, marquises, jardins, baixos de viadutos, terrenos baldios e áreas externas de imóveis.', 'Número total de indivíduos em situação de rua / População total *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('261', 'Favelas', 'Porcentagem de domicílios em favelas sobre o total de domicílios da região.', 'Número total de domicílios em favelas *100 / Número total de domicílios');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('269', 'Mortalidade por neoplasias (câncer)', 'Número de mortes por neoplasias (câncer), por cem mil habitantes.', 'Número de óbitos por neoplasias / População total *100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('300', 'Telecentros', 'Número de telecentros públicos, por 10 mil habitantes.', 'Número total de telecentros / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('131', 'Centros culturais, casas e espaços de cultura', 'Número de centros culturais, espaços e casas de cultura, municipais, estaduais, federais e particulares, por 10 mil habitantes.', 'Número de centros culturais, espaços e casas de cultura / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('282', 'População em situação de rua - acolhidos*', 'Porcentagem da população em situação de rua em cada região sobre o total da cidade.', 'Número total da população em situação de rua que foi acolhida / População total *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('153', 'Agressão a mulheres', 'Número de internações de mulheres de 20 a 59 anos por causas relacionadas a possíveis agressões, por 10 mil mulheres nessa faixa etária.', 'Número total de internações de mulheres residentes, de 20 a 59 anos, por causas relacionadas a possíveis agressões / População feminina na faixa etária de 20 a 59 anos *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('5', 'Leitos hospitalares', 'Proporção de leitos hospitalares públicos e privados disponíveis por mil habitantes.', 'Número total de leitos hospitalares / População total *1000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('167', 'Mortes por atropelamento', 'Número de mortes por atropelamentos, por 10 mil habitantes', 'Total de mortes por atropelamentos / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('242', 'Atendimento nas pré-escolas municipais', 'Número de matrículas nas pré-escolas (EMEIs) por habitante na faixa etária de 4 a 6 anos.', 'Número total de matrículas em pré-escolas municipais / População na faixa etária de 4 a 6 anos');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('116', 'Baixo peso ao nascer', 'Percentual de crianças nascidas vivas com menos de 2,5 kg, em relação ao total de nascidos vivos.', 'Número total de crianças com baixo peso ao nascer / Número total de nascidos vivos *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('4', 'Unidades Básicas de Saúde', 'Número de unidades básicas públicas de atendimento em saúde, por dez mil habitantes.', 'Número total de unidades básicas de atendimento em saúde / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('114', 'Gravidez na adolescência', 'Percentual de nascidos vivos cujas mães tinham 19 anos ou menos, sobre o total de nascidos vivos de mães residentes.', 'Número total de nascidos vivos cujas mães tinham 19 anos ou menos / Número total de nascidos vivos *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('98', 'Demanda atendida em creches', 'Percentual de matrículas efetuadas em relação ao total de inscritos (matriculas + demanda não atendida) por vagas.', 'Número de matrículas efetuadas em creches municipais / Número total de inscritos em creches (matrículas efetuadas + vagas solicitadas) *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('241', 'Atendimento nas creches municipais', 'Número de matrículas nas creches (diretas, indiretas e conveniadas) por habitante na faixa etária de 0 a 3 anos.', 'Número de matrículas efetuadas em creches municipais / População na faixa etária de 0 a 3 anos');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('7', 'Equipamentos esportivos', 'Número de equipamentos públicos municipais de esporte para cada 10 mil habitantes.', 'Número total de equipamentos esportivos públicos / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('3856', 'Idade média ao Morrer', 'Média de idade com que as pessoas morreram, por local de residência. A média é obtida a partir da divisão da soma das idades ao morrer pelo total de óbitos por todas as idades, ocorridos em determinado ano e localidade.', 'Idade média ao morrer');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('111', 'Mortalidade por doenças do aparelho respiratório', 'Número de mortes por doenças do aparelho respiratório, por 10 mil habitantes.', 'Número total de óbitos por doenças do aparelho respiratório / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('299', 'Teatros', 'Número de salas de teatro, municipais, estaduais, federais e particulares,  por 10 mil habitantes.', 'Número total de salas de teatro / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('6', 'Mortalidade infantil', 'Proporção de óbitos de crianças menores de um ano em cada mil crianças nascidas vivas de mães residentes.', 'Número total de óbitos com menos de um ano de idade / Número total de nascidos vivos *1000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('267', 'Mortalidade por causas externas', 'Número de óbitos por causas externas (acidentes e violências), por cem mil habitantes.', 'Número total de óbitos por causas externas / População total *100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('247', 'Cinemas', 'Número de salas de cinema, municipais, estaduais, federais e particulares, por 10 mil habitantes.', 'Número total de salas de cinema / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('147', 'Demanda atendida de vagas em pré-escolas municipais', 'Percentual de matrículas sobre o total de procura por vaga em pré-escolas municipais (educação infantil).', 'Número total de matrículas em pré-escolas municipais / Número total de inscritos em pré-escolas municipais (matrículas efetuadas + vagas solicitadas) *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('113', 'Pré-natal insuficiente', 'Percentual de nascidos vivos cujas mães fizeram menos de 7 consultas pré-natal.', 'Número total de nascidos vivos cujas mães fizeram menos de 7 consultas pré-natal / Número total de nascidos vivos *100');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('166', 'Mortes com bicicleta', 'Número de mortes de ocupantes de bicicleta, por 10 mil habitantes.', 'Total de mortes com bicicleta / População total *10000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('76', 'Mortes no trânsito', 'Número de mortes em acidentes de trânsito, por 100 mil habitantes.', 'Número de mortes em acidentes de trânsito ÷ População total × 100000');
INSERT INTO indicator (id, name, explanation, formula) VALUES ('22', 'Acervo de livros para adultos', 'Número de livros disponíveis em acervos de bibliotecas municipais por habitante com 15 anos ou mais.', 'Número total de livros para adultos disponíveis em bibliotecas municipais / População com 15 anos ou mais');
